 jatisunda_desc:0 "Le nom Jatisunda dérive de deux mots "Jati" qui signifie "Essence" et "Sunda" qui signifie "Lumière" ou "Eau". Le Jatisunda est par essence la foi originelle des Sundanais de l'ouest de Java. Elle met l'accent sur l'harmonie et s'appuie sur des conseils spirituels, des règles et des tabous."

